import React from 'react';
import { NavLink } from 'react-router-dom';

export const Contact = () => {
    return (
        <>
            <h1>I'm Contact</h1>
            <NavLink to='./Home.jsx'>Home</NavLink>
          <NavLink to='./About'>About</NavLink>
          <NavLink to='./Contact'>Contact</NavLink>
        </>
    )
}

export default Contact;
